Description:
Reminiscent of erotica from years ago when anything was possible and there were no taboos. IN YOUR FACE delivers exactly what you're looking for. For those that require a certain kind of visual impact, it's all here in vivid detail.
Our trip through the wild and very &quot;wet&quot; chance encounters are paved by the presence of a walking narrator (Buck Adams) who in a Serling-like fashion sets them up for your viewing pleasure. An unsuspecting bartender as she kneels behind the bar, a birthday &quot;gift&quot; from three lovely ladies, strangers in an apartment hallway with the chance of being caught... all the fantasies are here as we see some of the biggest names in adult films taking it where they should... in their face.

